// UTF-8 到 char 数组转换函数
// 参数：
//   utf8_str: UTF-8 编码的字符串
//   unicode_arr: 输出缓冲区 (固定大小 127 字节)
// 返回：
//   实际填充到数组中的字节数量
size_t utf8_to_char_fixed(const char *utf8_str, char unicode_arr[127]) {
    if (utf8_str == NULL || unicode_arr == NULL) {
        return 0;
    }
    
    const unsigned char *ptr = (const unsigned char *)utf8_str;
    size_t byte_count = 0;  // 已写入的字节数

    while (*ptr != '\0' && byte_count < 120) {
        // 处理 1 字节 ASCII (0xxxxxxx)
        if (ptr[0] < 0x80) {
            if(byte_count+2>127) break;

            // ASCII 字符存储为 2 个字节
            unicode_arr[byte_count++] = ptr[0];
            unicode_arr[byte_count++] = 0x00;
            ptr++;
            continue;
        }
        
        uint32_t code = 0;
        int bytes_consumed = 0;
        
        // 处理 2 字节序列 (110xxxxx 10xxxxxx)
        if ((ptr[0] & 0xE0) == 0xC0) {
            if (ptr[1] != '\0' && (ptr[1] & 0xC0) == 0x80) {
                code = ((ptr[0] & 0x1F) << 6) | (ptr[1] & 0x3F);
                bytes_consumed = 2;
            }
        }
        // 处理 3 字节序列 (1110xxxx 10xxxxxx 10xxxxxx)
        else if ((ptr[0] & 0xF0) == 0xE0) {
            if (ptr[1] != '\0' && (ptr[1] & 0xC0) == 0x80 &&
                ptr[2] != '\0' && (ptr[2] & 0xC0) == 0x80) {
                code = ((ptr[0] & 0x0F) << 12) | 
                       ((ptr[1] & 0x3F) << 6) | 
                       (ptr[2] & 0x3F);
                bytes_consumed = 3;
            }
        }
        // 处理 4 字节序列 (11110xxx 10xxxxxx 10xxxxxx 10xxxxxx)
        else if ((ptr[0] & 0xF8) == 0xF0) {
            if (ptr[1] != '\0' && (ptr[1] & 0xC0) == 0x80 &&
                ptr[2] != '\0' && (ptr[2] & 0xC0) == 0x80 &&
                ptr[3] != '\0' && (ptr[3] & 0xC0) == 0x80) {
                code = ((ptr[0] & 0x07) << 18) | 
                       ((ptr[1] & 0x3F) << 12) | 
                       ((ptr[2] & 0x3F) << 6) | 
                       (ptr[3] & 0x3F);
                bytes_consumed = 4;
            }
        }
        
        // 如果有有效序列被处理
        if (bytes_consumed > 0) {
            // 确保有足够空间存储 2 字节
            if (byte_count + 2 > 120) {
                // 空间不足，跳过此字符
                ptr += bytes_consumed;
                continue;
            }
            
            // // 存储为 2 字节 Unicode (大端序)
            // unicode_arr[byte_count++] = (code >> 8) & 0xFF; // 高字节
            // unicode_arr[byte_count++] = code & 0xFF;        // 低字节
            // 存储为 2 字节 Unicode (小端序)
            unicode_arr[byte_count++] = code & 0xFF;            // 高字节
            unicode_arr[byte_count++] = (code >> 8) & 0xFF;     // 低字节
            ptr += bytes_consumed;
        } else {
            // 无效序列或未处理，跳过当前字节
            ptr++;
        }
    }
    
    // 返回实际写入的字节数量
    if(byte_count < 120) {
        unicode_arr[byte_count] = 0; // 确保字符串以 null 结尾
        unicode_arr[byte_count+1] = 0; // 确保字符串以 null 结尾
        unicode_arr[byte_count+2] = 0; // 确保字符串以 null 结尾
    } else {
        unicode_arr[126] = 0; // 如果超出限制，确保最后一个字节是 null
        unicode_arr[125] = 0; // 如果超出限制，确保最后一个字节是 null
        unicode_arr[124] = 0; // 如果超出限制，确保最后一个字节是 null
    }
    return byte_count;
}

// 假设的字库结构 (需根据实际字库实现)
// 参数: gbk_code - GBK编码的字符
// 返回: 指向32字节字模数据的指针
// extern const unsigned char fontGBK[671936];
const unsigned char *get_font_data(uint16_t gbk_code) {
    // static JPet_Fonts JPetFonts;
    // 这里需要实现从字库中查找对应GBK编码的字模数据
    // 返回32字节的位图数据
    if(gbk_code < 0x80) {
        // ASCII字符处理
        return (fontGBK+(gbk_code-0x20)*32); // 假设ASCII从0x20开始
    } else {
        // GBK字符处理
        return (fontGBK+((gbk_code-0x4E00+96)*32));
    }
    return NULL; // 示例返回
}

// 在LCD缓冲区绘制字符（行优先扫描）
// frame: 480x480x3的RGB缓冲区
// code: GBK字符编码
// x0, y0: 字符左上角坐标
// color: RGB颜色值 (0xRRGGBB)
void draw_char(uint8_t *frame, uint16_t code, int x0, int y0, uint32_t color) {
    const unsigned char *font = get_font_data(code);
    if (!font) return;
    // ESP_LOGI(TAG, "code:%d, x0:%d, y0:%d.",code, x0, y0);
    
    uint8_t r = (color >> 16) & 0xFF;
    uint8_t g = (color >> 8) & 0xFF;
    uint8_t b = color & 0xFF;
    int is_ascii = (code <= 0x7F); // ASCII字符范围
    
    // 行优先扫描：从上到下，每行从左到右
    for (int y = 0; y < 16; y++) {
        // 每行2字节（16位）
        uint16_t row_data = (font[y * 2] << 8) | font[y * 2 + 1];
        
        // 处理当前行的所有16个像素
        for (int x = 0; x < 16; x++) {
            // 只处理有效像素：ASCII只处理前8位
            if (is_ascii && x >= 8) break;
            
            // 检查当前位是否为1 (高位在前)
            if (row_data & (0x8000 >> x)) {
                int px = x0 + x;
                int py = y0 + y;
                
                // 边界检查
                if (px >= 0 && px < 480 && py >= 0 && py < 480) {
                    int offset = (py * 480 + px) * 3;
                    frame[offset] = r;
                    frame[offset + 1] = g;
                    frame[offset + 2] = b;
                }
            }
            // } else{ //底色
            //     int px = x0 + x;
            //     int py = y0 + y;
                
            //     // 边界检查
            //     if (px >= 0 && px < 480 && py >= 0 && py < 480) {
            //         int offset = (py * 480 + px) * 3;
            //         frame[offset] = 0x00;
            //         frame[offset + 1] = 0xA5;
            //         frame[offset + 2] = 0xFF;
            //     }
            // }
        }
    }
        // 行优先扫描：从上到下，每行从左到右
        // 错位描边
        x0+=1;
        y0+=1;
    for (int y = 0; y < 16; y++) {
        // 每行2字节（16位）
        uint16_t row_data = (font[y * 2] << 8) | font[y * 2 + 1];
        
        // 处理当前行的所有16个像素
        for (int x = 0; x < 16; x++) {
            // 只处理有效像素：ASCII只处理前8位
            if (is_ascii && x >= 8) break;
            
            // 检查当前位是否为1 (高位在前)
            if (row_data & (0x8000 >> x)) {
                int px = x0 + x;
                int py = y0 + y;
                
                // 边界检查
                if (px >= 0 && px < 480 && py >= 0 && py < 480) {
                    int offset = (py * 480 + px) * 3;
                    frame[offset] = 0x00;
                    frame[offset + 1] = 0x00;
                    frame[offset + 2] = 0xFF;
                }
            }
            // } else{ //底色
            //     int px = x0 + x;
            //     int py = y0 + y;
                
            //     // 边界检查
            //     if (px >= 0 && px < 480 && py >= 0 && py < 480) {
            //         int offset = (py * 480 + px) * 3;
            //         frame[offset] = 0x00;
            //         frame[offset + 1] = 0xA5;
            //         frame[offset + 2] = 0xFF;
            //     }
            // }
        }
    }
}

// 绘制字幕到屏幕中心靠下位置
// frame: 480x480x3 RGB缓冲区
// text: GBK编码的字符串
// color: 文字颜色 (0xRRGGBB)
void draw_subtitle(uint8_t *frame, const uint16_t *text, uint32_t color) {
    const int max_width = 320;      // 屏幕宽度
    const int line_height = 16;     // 行高
    const int bottom_margin = 50;   // 底部边距
    const int max_lines = 2;        // 最大行数
    
    // 计算两行文本的起始Y坐标
    int total_height = max_lines * line_height;
    int start_y = 480 - bottom_margin - total_height;
    
    // 分行处理
    int line_widths[max_lines] = {0};
    int line_count = 0;
    
    // 临时缓冲区存储每行文本
    uint16_t line_buf[max_lines][100] = {{0}, {0}};
    const uint16_t *p = text;
    
    // 分行计算宽度
    while (*p && line_count < max_lines) {
       
        int cur_width = 0;
        uint16_t *line = line_buf[line_count];
        
        while (*p) {
            
            uint16_t char_width = 0;
            // uint16_t char_code = 0;
            
            // 处理GBK字符
            if (((uint16_t)*p >= 0x4E00) && (uint16_t)*p <= 0x9FA5) {
                char_width = 16;
                
                // 检查宽度是否超出
                if (((cur_width + char_width) > max_width) && (cur_width > 0)) 
                    break;
                    
                // 保存完整GBK字符
                *line++ = *p++;
            } 
            // 处理ASCII字符
            else if (((uint16_t)*p >= 0x0020) && ((uint16_t)*p <= 0x007F)) {
                char_width = 8;
                
                // 检查宽度是否超出
                if (((cur_width + char_width) > max_width) && (cur_width > 0)) 
                    break;
                    
                *line++ = *p++;
            } 
            // 跳过非法字符,填充为空格
            else {
                char_width = 8; // 假设非法字符宽度为8

                // 检查宽度是否超出
                if (((cur_width + char_width) > max_width) && (cur_width > 0)) 
                    break;

                *line++=0x0020; // 填充空格字符
                p++;
            }
            
            cur_width += char_width;
        }

        *line = 0; // 以0结尾标识行结束
        if (cur_width == 0) break; // 如果当前行没有字符，结束
        
        line_widths[line_count] = cur_width;
        line_count++;
    }

    // 绘制文本行
    for (int i = 0; i < line_count; i++) {
        int x = (480 - line_widths[i]) / 2; // 水平居中
        int y = start_y + i * line_height;
        
        const uint16_t *p = line_buf[i];
        while (*p) {
            // ESP_LOGI(TAG, "text:%d", *p);
            
            // 绘制字符
            draw_char(frame, *p, x, y, color);
            
            // 更新X位置
            x += (*p < 0x0080) ? 8 : 16;
            p++;
        }
    }
}

bool frame_rate_print(gptimer_handle_t timer, const gptimer_alarm_event_data_t *edata, void *user_data)
{
    ESP_DRAM_LOGI("TimerGroup", "frame:%d fps\r\n", g_frame);
    g_frame = 0;
    return pdTRUE;
}
void frame_rate_timer(void)
{
    gptimer_config_t timer_config = {
        .clk_src   = GPTIMER_CLK_SRC_DEFAULT,   /* 定时器默认时钟源 */
        .direction = GPTIMER_COUNT_UP,          /* 向上计数 */
        .resolution_hz = 1000000,               /* 分辨率 */
    };
    gptimer_new_timer(&timer_config, &gptimer); /* 将配置设置到定时器 */

    gptimer_event_callbacks_t cbs = {           /* 绑定一个回调函数 */
        .on_alarm = frame_rate_print,           
    };
    gptimer_register_event_callbacks(gptimer, &cbs, NULL);  /* 设置定时器的回调函数cbs,不需要传入参数 */

    gptimer_enable(gptimer);                    /* 使能定时器 */

    gptimer_alarm_config_t alarm_config;
        alarm_config.reload_count               = 0;        /* 重载计数值为0 */
        alarm_config.alarm_count                = 1000000;  /* 报警值,1s */
        alarm_config.flags.auto_reload_on_alarm = true;     /* 开启重加载 */
    gptimer_set_alarm_action(gptimer, &alarm_config);

    gptimer_start(gptimer);
}

int JPet_jpegDecodeInit(void){
    jpeg_decode_engine_cfg_t decode_eng_cfg = {
        .timeout_ms = 40,
    };

    ESP_ERROR_CHECK(jpeg_new_decoder_engine(&decode_eng_cfg, &jpgd_handle));

    jpeg_decode_memory_alloc_cfg_t rx_mem_cfg = {
        .buffer_direction = JPEG_DEC_ALLOC_OUTPUT_BUFFER,
    };

    size_t rx_buffer_size_480p = 0;
    graph_buf_480p = (uint8_t*)jpeg_alloc_decoder_mem(691200, &rx_mem_cfg, &rx_buffer_size_480p);
    if (graph_buf_480p == NULL) {
        ESP_LOGE(TAG, "alloc 480p rx buffer error");
        return -1;
    }

    return 0;
}

