bool parse_avi_header(const char *path) {
    uint32_t file_pos;
    player.file = fopen(path, "rb");
    if (!player.file) {
        printf( "Failed to open file: %s\n", path);
        return false;
    }

    // 读取RIFF头
    AVIHeader header;
    printf("AVIHeader size:%d\n", sizeof(AVIHeader));
    if (fread(&header, sizeof(AVIHeader), 1, player.file) != 1) {
        printf( "Failed to read AVI header\n");
        fclose(player.file);
        player.file = NULL;
        return false;
    }
    
    // 检查RIFF标识
    if (header.riff_id != 0x46464952) { // 'RIFF'
        printf( "Invalid RIFF header: 0x%08lX\n", header.riff_id);
        fclose(player.file);
        player.file = NULL;
        return false;
    }
    
    // 检查AVI标识
    if (header.avi_id != 0x20495641) { // 'AVI '
        printf( "Invalid AVI header: 0x%08lX\n", header.avi_id);
        fclose(player.file);
        player.file = NULL;
        return false;
    }

    // 添加关键日志
    printf( "Parsing AVI file: %s\n", path);
    printf( "RIFF size: %u bytes\n", (unsigned int)header.riff_size);
// ok
    // 读取LIST头
    LISTHeader list_header;
    if (fread(&list_header, sizeof(LISTHeader), 1, player.file) != 1) {
        printf( "Failed to read LIST header\n");
        fclose(player.file);
        player.file = NULL;
        return false;
    }
    if(list_header.list_id != 0x5453494C){  // LIST
        printf("LIST HEADER error.\n");
        return false;
    }
    if(list_header.list_type != 0x6C726468){ // hdrl
        printf("hdrl id error.\n");
        return false;
    }
    printf("LIST size: %lu bytes\n", list_header.list_size);

    AVIMainHeader avi_mainHeader;
    printf("AVIMainHeader size:%d\n",sizeof(AVIMainHeader));
    if (fread(&avi_mainHeader, sizeof(AVIMainHeader), 1, player.file) != 1) {
        printf( "Failed to read AVI MAIN header\n");
        fclose(player.file);
        player.file = NULL;
        return false;
    }
    if(avi_mainHeader.avih_id != 0x68697661){   // avih
        printf("avih header error.\n");
        return false;
    }
    player.frame_delay_us = avi_mainHeader.us_per_frame;
    player.frame_count = avi_mainHeader.total_frames;
    player.width = avi_mainHeader.width;
    player.height = avi_mainHeader.height;
                    
    printf( "Video info: %ldx%ld, Frames: %lu, FPS: %.1f\n", 
            player.width, player.height, player.frame_count,
            player.frame_delay_us > 0 ? 1000000.0f / player.frame_delay_us : 0);
    printf("avih_size:%lu\n",avi_mainHeader.avih_size);

    // seek first chunk
    uint32_t chunk_id;
    while(!feof(player.file)){
        if (fread(&chunk_id, 4, 1, player.file) != 1) break;
        if(0x69766F6D == chunk_id){ // movi
            // player.movi_start = ftell(player.file) - 4;
            player.movi_start = ftell(player.file);
            printf( "MOVI list found at %lu\n", player.movi_start);
            return true;
            break;
        }
    }

    fclose(player.file);
    // player.file = NULL;
    return false;
}

void JPet_decodeAndPopulateGraphBuffer(uint8_t *jpeg_data, unsigned long size){
    // // Get the jpg header information (This step is optional)
    jpeg_decode_picture_info_t header_info;
    ESP_ERROR_CHECK(jpeg_decoder_get_info(jpeg_data, size, &header_info));
    // ESP_LOGI(TAG, "header parsed, width is %" PRId32 ", height is %" PRId32, header_info.width, header_info.height);

    uint32_t out_size_480p = 0;
    ESP_ERROR_CHECK(jpeg_decoder_process(jpgd_handle, &decode_cfg_rgb, jpeg_data, size, graph_buf_480p, 691200, &out_size_480p));
    // printf("out_size:%lu\n",out_size_480p);
}

bool javi_play(const char *path, bool loop) {
    if (player.is_playing) {
        player.is_playing = false;
        // vTaskDelay(pdMS_TO_TICKS(50)); // 等待任务退出
    }
    if (player.file) {
        fclose(player.file);
        player.file = NULL;
    }

    if (!parse_avi_header(path)) {
        printf("avi header parse fail.\n");
        return false;
    }
    printf("avi header parse ok.\n");

    player.loop = loop;
    player.is_playing = true;
    player.current_frame = 0;
    return true;
}

