JPetLcdDisplay::JPetLcdDisplay(esp_lcd_panel_handle_t panel)
    : NoDisplay() {
    m_panel = panel;

    trans_done_sem = xSemaphoreCreateCounting(1, 0);
    xSemaphoreGive(trans_done_sem);
    esp_lcd_dpi_panel_event_callbacks_t cbs = {
        .on_color_trans_done = JPet_lcd_ready_callback,
    };
    ESP_ERROR_CHECK(esp_lcd_dpi_panel_register_event_callbacks(m_panel, &cbs, nullptr));

    //  init JPeg decoder
    JPet_jpegDecodeInit();
    ESP_LOGI(TAG, "jpeg decode init ok.");
    // init anim player task
    javi_init(512*1024);
    anim_queue = xQueueCreate(20, 128);
    // 创建播放任务
    xTaskCreatePinnedToCore(playback_task, "avi_playback", 4096, NULL, 5, NULL, 0);
    // char temp[128]={1};
    // utf8_to_char_fixed("你好世界", (temp+1));
    // temp[127]=0;
    // draw_subtitle(graph_buf_480p, (uint16_t*)(temp+1), 0xFFFFFF);
    // JPet_lcd_flush();
    // 播放startup视频（循环播放）
    frame_rate_timer();
    char startup_movie_cmd[128]={0,1,'/','s','d','c','a','r','d','/','r','e','l','a','x','e','d','.','a','v','i',0};
    xQueueSend(anim_queue, startup_movie_cmd, 0);
}

void JPetLcdDisplay::SetEmotion(const char* emotion) {
    static char emotion_cmd[128]={0,1};
    static const std::unordered_map<std::string, std::string> emotion_map = {
        { "neutral"     ,"/sdcard/relaxed.avi"},
        { "happy"       ,"/sdcard/relaxed.avi"},
        { "laughing"    ,"/sdcard/relaxed.avi"},
        { "funny"       ,"/sdcard/relaxed.avi"},
        { "sad"         ,"/sdcard/relaxed.avi"},
        { "angry"       ,"/sdcard/relaxed.avi"},
        { "crying"      ,"/sdcard/crying.avi"},
        { "loving"      ,"/sdcard/relaxed.avi"},
        { "embarrassed" ,"/sdcard/relaxed.avi"},
        { "surprised"   ,"/sdcard/surprised.avi"},
        { "shocked"     ,"/sdcard/shocked.avi"},
        { "thinking"    ,"/sdcard/thinking.avi"},
        { "winking"     ,"/sdcard/relaxed.avi"},
        { "cool"        ,"/sdcard/relaxed.avi"},
        { "relaxed"     ,"/sdcard/relaxed.avi"},
        { "delicious"   ,"/sdcard/relaxed.avi"},
        { "kissy"       ,"/sdcard/relaxed.avi"},
        { "confident"   ,"/sdcard/confident.avi"},
        { "sleepy"      ,"/sdcard/relaxed.avi"},
        { "silly"       ,"/sdcard/relaxed.avi"},
        { "confused"    ,"/sdcard/confused.avi"}
    };
    
    // 查找匹配的表情
    // 如果找到匹配的表情就显示对应图标，否则显示默认的neutral表情
    auto it = emotion_map.find(emotion);
    if (it != emotion_map.end()) {
        const auto emotion_to_show = it->second;
        // ESP_LOGI(TAG, "emotion movie: %s, size: %d", emotion_to_show.c_str(), sizeof(emotion_to_show.c_str()));
        // memcpy(emotion_cmd+2, emotion_to_show.c_str(), sizeof(emotion_to_show.c_str()));
        strncpy(emotion_cmd + 2, emotion_to_show.c_str(), 125);
        xQueueSend(anim_queue, emotion_cmd, 0);
    } else {
        ESP_LOGE(TAG, "emotion not find.");
    }

}

void JPetLcdDisplay::SetChatMessage(const char* role, const char* content) {
    ESP_LOGI(TAG, "SetChatMessage role:%s, content:%s", role, content);
    // 如果role=“assistant”，则发送内容
    if (strcmp(role, "assistant") == 0) {
        static char chat_cmd[128] = {1};
        // strncpy(chat_cmd + 1, content, 126);
        utf8_to_char_fixed(content, (chat_cmd + 1));
        // for (int i = 0; i < 128; i++) {
        //     ESP_LOGI(TAG, "first: 0x%x", chat_cmd[i]);
        // }
        chat_cmd[127] = 0; // 确保字符串以null结束
        xQueueSend(anim_queue, chat_cmd, 0);
    }
    return;
}

